import styled from "styled-components";

const StyledPokemonInfo = styled.div`
  border: 1px solid white;
`;

function SinglePokemonInfo(props) {
  console.log(props.name);
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.imgPath} />
      <StyledPokemonInfo>
        <table>
          <tr>
            <td>Height</td>
            <td></td>
          </tr>
        </table>
      </StyledPokemonInfo>
    </div>
  );
}

export default SinglePokemonInfo;
